Description: Remy Lacroix, in a range, shooting guns. Excited? Of course you are! We spent an afternoon with Remy after one of her shoots and met up with her at a local gun range for some target practice. This girl is something else. If you need any other reason to prove why she's the shit, this is it. Not only did Remy work her way through some pistols, but she also tackled an M16, an AK-47, and two special big guns. There are no blanks being fired here! Enjoy!

